  false,\n\t\"url\": null,\n\t\"notes\": \"The main purpose of this report is to present
  the results of drilling a 4485-foot core hole in the southeastern corner of Mainside.
  This information, coupled with what was already known from previous exploration
  efforts, provided us with the opportunity to refine our interpretations of the geothermal
  system present beneath Mainside. Although some important data remain to be gathered
  about the resource, such as fluid availability and dynamics, we believe that a geothermal
  system is present in the southeastern corner of Mainside, that it is exploitable.
  and that it could he used to make Mainside energy self-sufficient.\",\n\t\"license_title\":
